Can you try making this change in _infer_If? 

Original:
```
        if cond is not None:
            if cond > 0:
```
New:
```
        if cond is not None:
            # ONNX allows cond to be a scalar (shape []) or list with one element (shape [1])
            if cond is list:
                assert len(list) == 1
                cond = cond[0]
                
            if cond > 0:
```

Sorry for the late reply... @skottmckay There's one place that is missed: [here](https://github.com/microsoft/onnxruntime/blob/master/onnxruntime/python/tools/symbolic_shape_infer.py#L767)

It should be:

if cond is not None and i_sub == (0 if **as_scalar**(cond) > 0 else 1):
